import React from 'react';
import './Histoire.css';

const Histoire = () => {
  return (
    <div>
      <div className="space-200px"></div>
      <div className="space-50px"></div>

      <img src="mon-histoire.svg" alt="" className="centered-image" />
      <div className="space-50px"></div>


    </div>
  );
}

export default Histoire;
